$(document).ready(function(){
	$('.wpcf7-form .agree').prop('checked', false);
})

document.addEventListener('DOMContentLoaded', function(){
       var x = document.getElementsByClassName("agree");
       var i;
       for (i = 0; i < x.length; i++) {
            x[i].checked = false;
       }
})

document.addEventListener('DOMContentLoaded', function () {
  var $navbarBurgers = Array.prototype.slice.call(document.querySelectorAll('.main-nav__link.scrollLink'), 0);
  if ($navbarBurgers.length > 0) {
    $navbarBurgers.forEach(function ($el) {
      $el.addEventListener('click', function () {
        var $target = document.getElementById('main-nav');
        $target.classList.toggle('active');
		var $target = document.getElementById('main-nav-toggler');
        $target.classList.toggle('burger--close');
		
      });
    });
  }

});